import { HttpErrorResponse } from '@angular/common/http';
import { Component } from '@angular/core';
import { ActivatedRoute, Router } from '@angular/router';
import { User } from 'src/app/models/User';
import { Visite } from 'src/app/models/Visite';
import { VisiteService } from 'src/app/services/visite.service';

@Component({
  selector: 'app-liste-visite-by-id',
  templateUrl: './liste-visite-by-id.component.html',
  styleUrls: ['./liste-visite-by-id.component.css']
})
export class ListeVisiteByIDComponent {
  visites: Visite[] = [];
  users: User[] = [];
  errorMessage: string = '';

  constructor(
    private visiteService: VisiteService, 
    private route: ActivatedRoute
  ) {}

  ngOnInit(): void {
    const patientId = this.route.snapshot.paramMap.get('PatientId');
    console.log('PatientId from route:', patientId); // Log the PatientId

    if (patientId) {
      this.getVisitesByPatientId(parseInt(patientId));
      this.getUsers();
    }
  }

  getVisitesByPatientId(patientId: number): void {
    this.visiteService.getById(patientId)
      .subscribe(
        data => {
          console.log('API Response:', data); // Log the data to see what is returned
          this.visites = data;
          console.log('Visites array:', this.visites); // Log the visites array
        },
        (error: HttpErrorResponse) => {
          console.error('There was an error!', error);
          this.errorMessage = 'An error occurred while fetching visits data.';
        }
      );
  }

  getUsers(): void {
    this.visiteService.GetUsers()
      .subscribe(
        usersData => {
          console.log('Users data:', usersData); // Log the users data
          this.users = usersData;
        },
        (error: HttpErrorResponse) => {
          console.error('There was an error fetching users!', error);
          this.errorMessage = 'An error occurred while fetching users data.';
        }
      );
  }

  getUserFullName(userId: number): string {
    // Find the user by userId in the users array
    const user = this.users.find(u => u.userId === userId);
    
    // If user is found, return their full name; otherwise, return 'Unknown'
    return user ? `${user.nom} ${user.prenom}` : 'Unknown';
  }
}
